import styled from "styled-components";

inter

export const Container = styled.div`
  width: 285px;
  width: ${(props) => props.width};
  height: 420px;
  border: 1px solid blue;
`;

export const Img = styled.img`
  width: 285px;
  height: 285px;
  border: 1px solid red;
  border-radius: 14px;
`;
